// Desectructuracion Asignación Desuctucturante. Este es un tema muy importante para el uso de React

const persona = {
  nombre: "John",
  apellido: "Doe",
  edad: 30,
  direccion: {
    calle: "123 Main St",
    ciudad: "New York",
    pais: "USA",
  },
};

console.log(`Persona:
    nombre: ${persona.nombre}
    apellido: ${persona.apellido}
    edad: ${persona.edad}
    direccion:
        calle: ${persona.direccion.calle}
        ciudad: ${persona.direccion.ciudad}
        pais: ${persona.direccion.pais}`);

const { nombre, apellido, edad, direccion } = persona;

console.log(`Persona Desectructurada:
    nombre: ${nombre}
    apellido: ${apellido}
    edad: ${edad}
    direccion:
        calle: ${direccion.calle}
        ciudad: ${direccion.ciudad}
        pais: ${direccion.pais}`);
